// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function Projects() {
    return (
        // AboutMe Container.
        <>
            <div id="MyProjects">
                <div id="MyProjectsHeader" class="jumbotron text-center">
                    <h1 class="card-title display-3 pb-2"><strong>My Projects.</strong></h1>
                    <p class="card-text">
                        This is a short preview of each of my six most proud projects from school, work, and personal. You can cycle through the list by tapping the small blue circles at the bottom of the project cards or by swiping left or right on the screen. If you want to view more of my work, please visit my Github or LinkedIn for more information.
                    </p>

                    <a class="fa-lg p-2 m-2 li-ic"><i class="fab fa-linkedin-in grey-text"></i></a>
                    <a class="fa-lg p-2 m-2 tw-ic"><i class="fab fa-twitter grey-text"></i></a>
                    <a class="fa-lg p-2 m-2 fb-ic"><i class="fab fa-facebook-f grey-text"></i></a>
                </div>
            </div>
        </>
    );
}
// Do export.
export default Projects;
